// Sequence starts at 29, because of seq embedded in magic packets. (0xEB >> 3)
var seq = 29; 
function GetPacketSequence()
{
    seq++;
    if (seq > 31) seq = 1;
    
    var shift = seq << 3;

    return shift + 4;
}


var table = [];
var PEC_MSB_MASK = 1 << (8 - 1);
var PEC_MASK = (PEC_MSB_MASK << 1) - 1;
var PEC_POLY = (0b100000111 & PEC_MASK);


function GeneratePecTable() {
    for (var iIdx = 0; iIdx < 256; iIdx++) {
        var iReg = iIdx;
        for(var iBit = 0; iBit < 8; iBit++){
            if ((iReg & PEC_MSB_MASK) !== 0) {
                iReg = (iReg << 1) ^ PEC_POLY;
            } else {
                iReg = (iReg << 1);
            }
        }
        table[iIdx] = iReg & PEC_MASK;
    }
}


function ComputePec(bytes) {
    if (table.length === 0) { GeneratePecTable(); }

    var iCrc = 0;
    var sStr = "PEC:";
    for (var iIdx = 0; iIdx < bytes.length; iIdx++) {
        var iTableIdx = iCrc ^ bytes[iIdx];
        iCrc = table[iTableIdx];
        if (iIdx === 0){
            sStr += bytes[iIdx] + ' ';
        } else {
            sStr += bytes[iIdx].toString(16) + ' ';
        }
    }

    return iCrc;
}


export function Render()
{
    var packet = new Array(65).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x3F;
    packet[2] = GetPacketSequence();

    

    for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++)
    {
        var iLedIdx = (iIdx * 3) + 3;
        
        var col = device.color(vLedPositions[iIdx][0],vLedPositions[iIdx][1]);
        packet[iLedIdx] = col[2];
        packet[iLedIdx + 1] = col[1];
        packet[iLedIdx + 2] = col[0];
    }

    packet[64] = ComputePec(packet.slice(2,64));

    device.write(packet, 65);
}


